const ChatFormWrapper = styled.form`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;
  position:relative;

  .chatting_input{
    width:100%;
    height:45px;
  }

  .chatting_submit{
    position:absolute;
    right:15px;
    top:10px;
  }

`;

interface Props { 

}

const ChatForm = ({  }:Props):JSX.Element=> {

  return (
    <ChatFormWrapper>
      <input className="chatting_input" type="text" /> 
      <button className="chatting_submit">Send</button>
    </ChatFormWrapper>
  )

}

export default ChatForm;
